import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD App</h1>
      <div className='form'>
        <label>Jugador: </label>
        <input type='text' name='jugador' />
        <label>Puntaje: </label>
        <input type='text' name='review' />
      </div>
    </div>
  );
}

export default App;
